        readonly static char[] SpecialInvalidAtStart = new char[]
        {
            'c','C','r','R'
        };

        public static bool IsValidName(string name)
        {
            if (name.IndexOfAny(AlwaysInvalidChars) > -1)
            {
                return false;
            }

            if (name[0].ToString().IndexOfAny(InvalidAtStartChars) > -1)
            {
                return false;
            }

            //Special case 'c','C','r','R' only
            if (name.Length == 1 && name.IndexOfAny(SpecialInvalidAtStart) > -1)
            {
                return false;
            }

            //Special case '\' followed by 1 character
            if (name.Length == 2 && name[0] == (char)92)
            {  
                return false;
            }

            //Length
            if (name.Length > 255)
            {
                return false;
            }

            if(ExcelCellBase.IsValidAddress(name))
            {
                return false;
            }

            //TODO:Add check for functionnames.
            return true;
        }
        public static string GetValidName(string name)
        {
            if (string.IsNullOrEmpty(name))
            {
                return name;
            }

            var fc = name[0];
            if (!(char.IsLetter(fc) || fc == '_' || (fc == '\\' && name.Length > 2)))
            {
                name = "_" + name.Substring(1);
            }

            name=NameInvalidChars.Aggregate(name, (c1, c2) => c1.Replace(c2, '_'));
            return name;
        }
    }
